import React from 'react'
import './Acceuil.css'

function Acceuil() {
  const backgroundImageUrls = [
    'url(/public/Acc1.jpg)',
    'url(/public/Acc2.jpg)',
    'url(/public/Acc1.jpg)',
    'url(/public/Acc2.jpg)',
  ];

  return (
    <div className="background-container">
      <div className="background-image image1" style={{ backgroundImage: backgroundImageUrls[0] }}></div>
      <div className="background-image image2" style={{ backgroundImage: backgroundImageUrls[1] }}></div>
      <div className="background-image image3" style={{ backgroundImage: backgroundImageUrls[2] }}></div>
      <div className="background-image image4" style={{ backgroundImage: backgroundImageUrls[3] }}></div>
    </div>
  )
}

export default Acceuil
